# AMD64 (64-bit) Linux/SuSE Pathscale v2.3 config file 
# Config file for CPU2006
#####################################################################

ignore_errors = yes
tune          = base
ext           = my
output_format = asc,html
teeout        = yes
teerunout     = yes

default=default=default=default:
#####################################################################
# Compiler selection
#
#
CC           = gcc #-fno-strict-aliasing -funroll-loops -fpeel-loops -ftracer -finline-functions
CXX          = g++ #-fno-strict-aliasing -funroll-loops -fpeel-loops -ftracer -finline-functions
FC           = gfortran #-fno-strict-aliasing #-m32 # -gnu4
#FLD = pathf90 
#F77LD = pathf90

#####################################################################
# Optimization
#####################################################################
default=peak=default=default:
COPTIMIZE    = -O2 -static 
CXXOPTIMIZE  = -O2 -static
FOPTIMIZE    = -O2 -static

notes0100= C/C++ peak flags:
notes0110= Fortran peak flags:

default=base=default=default:
COPTIMIZE    = -O2 -static
CXXOPTIMIZE  = -O2 -static 
FOPTIMIZE    = -O2 -static 


notes0100= C/C++ base flags:
notes0110= Fortran base flags:

#####################################################################
# INT Portability
#####################################################################

400.perlbench=default=default=default:
PORTABILITY = -DSPEC_CPU_LINUX_IA32 -std=gnu90
notes30    = 400.perlbench

403.gcc=base=default=default:
PORTABILITY=

#416.games=default=default=default:
#PORTABILITY = -funconstrained-commons

462.libquantum=default=default=default:
notes60= 462.libquantum: -DSPEC_CPU_LINUX
PORTABILITY=  -DSPEC_CPU_LINUX

483.xalancbmk=default=default=default:
EXTRA_CXXFLAGS= -DSPEC_CPU_LINUX  -include string.h -include cstdlib -include cstring

#####################################################################
# FP Portability
#####################################################################

436.cactusADM=default=default=default:
notes45= cactusADM: FPORTABILITY= -fno-second-underscore
FPORTABILITY= -fno-second-underscore

447.dealII=default=default=default:
PORTABILITY = -DSPEC_CPU_TABLE_WORKAROUND -include cstdlib -include cstring
CXXPORTABILITY = -include cstdlib -include cstring
notes50= 447.dealII: -DSPEC_CPU_TABLE_WORKAROUND
LIBS= -lpthread

465.tonto=default=default=default:
FPPPORTABILITY= -DLANGUAGE_FORTRAN_90
notes75= 465.tonto: FPPPORTABILITY= -DLANGUAGE_FORTRAN_90

481.wrf=default=default=default:
notes85= 481.wrf: FPORTABILITY= -fno-second-underscore, CPORTABILITY= -DSPEC_CPU_LINUX -DPATHSCALE_COMPILER
